(1, 1, 'Always', 'Mostly', 'Sometimes', 'Following distances are not respected on site', 'I don''t know', 'Following distances on site for haul trucks are 140m in the winter and 70m in the summer.', 'Following Distance', 'Do vehicles respect site following distances?'),
