(5, 29, 'Always', 'Mostly', 'Somewhat', 'Communication channels were unreliable', 'I don''t know', 'Vehicle Radio signals are strong and consistent across the site.  Radio channels are known and complied with across the site.', 'Communication', 'Are communications with other vehicles reliable?'),
