(7, 31, 'Always', 'Mostly', 'Sometimes', 'Vehicle parking is inconsistent', 'I don''t know', 'Parking areas are those areas that are designated for parked heavy and light vehicles.  These areas are clearly demarcated, have good flow of traffic in and out and facilitate pull through or safe reverse parking.', 'Vehicle Parking', 'Were vehicles parked in designated areas?'),
(8, 32, 'Always', 'Mostly', 'Sometimes', 'RoW is inconsistent', 'I don''t know', 'Surface right-of- way shall be granted in the following order:\no Pedestrians\no Ambulance or other emergency mobile equipment \no Explosives transport\no Blind side equipment\no Haulage equipment\no Road maintenance equipment\no Light vehicles\nAnywhere haul roads merge, right-of-way shall be given to trucks on the left due to the blind side merging with traffic, unless signage dictates otherwise.', 'Right of Way', 'Do vehicles respect right of way (RoW) of other vehicles?'),
(9, 33, 'Always', 'Mostly', 'Sometimes', 'Inconsistent', 'I don''t know', 'Correct areas refer to areas of the site where certain types of vehicles have access and these areas are clearly demarcated', 'Exclusion Zones', 'Were vehicles operating in the correct areas of the site?'),
