(11, 36, 'Always', 'Mostly', 'Sometimes', 'Not at all', 'I don''t know', 'Waste dump traffic: Vehicles have known path to unload waste and clear exit path \nWaste dump design: berm and crest integrity is high\nWaste dump spotter: Spotters are available to support drivers; where spotters are not available, vehicles should dump short', 'Waste Dumps', 'Were waste dump areas designed to standard?'),
(12, 37, 'Never', 'Once', 'Sometimes', 'Almost always', 'I don''t know', 'Site rules state that communication devices are not to be used by the operator while vehicle is in motion.', 'Mobile Devices', 'Were mobile devices used in moving vehicles by operators?'),
(13, 39, 'Excellent - no slippage', 'Only one area where slippage occurrs', 'Multiple areas where slippage occurrs', 'Slippage is a regular occurrence', 'I don''t know', 'Traction control is very important in heavy equipment.  Through road condition, grade or other factors, maintaining tractor throughout each cycle should not be compromised.', 'Traction', 'What are the traction conditions on the site?'),
(14, 41, 'Always', 'Mostly', 'Sometimes', 'Barricading is poor and/or inconsistent', 'I don''t know', 'Prohibited roads should be adequately barricaded that accidental access should be discouraged by the design of the barricade (including berms, concrete or waste rock).  Also, barricades that are not required are removed in a timely manner.', 'Barricading', 'Are prohibited roads adequately barricaded to block vehicle access?'),
(15, 43, 'Always', 'Mostly', 'Sometimes', 'Vehicle convoys and escorts were not followed across site', 'I don''t know', 'Escort vehicles are required for vehicles that have abnormal loads or require access to otherwise prohibited areas of the site.', 'Escort / Convoy', 'Are vehicles requiring escort/convoy accompanied by an appropriate vehicle?'),
(16, 44, 'Always', 'Mostly', 'Sometimes', 'Tight parking not regularly controled by flag personnel', 'I don''t know', 'When parking vehicles in tight parking spots, best in class practice includes having one or two people direct the vehicle into place using flags and communicating directly with the operator of the heavy vehicle.', 'Tight Parking', 'Are vehicles parking in tight spaces accompanied by flag personnel?'),
(17, 25, 'Always', 'Mostly', 'Sometimes', 'Speed limits were not followed on site', 'I don''t know', 'Speed limits within active mining areas or heavy equipment areas that are designated with left hand traffic are: Haul Roads – 60km/h; Dumping and Loading Areas – 20 km/h; Shops, Ready Lines, and Fuel Bays – 15km/h.', 'Speed Limits', 'Do vehicles follow the posted speed limits?'),
(18, 35, 'Always', 'Usually', 'Sometimes', 'Never', 'I don''t know', 'Contractors are obliged to follow the same site rules as company vehicles as it relates to:\n- driving behaviours\n- speed limits\n- vehicle condition and requirements\n- access requirements', 'Contractors Practices', 'Were contractors'' practices consistent with that to of site vehicles?'),
(19, 38, 'Never', 'Rarely', 'Sometimes', 'Vehicles are passed regularly regardless of area of site', 'I don''t know', 'Passing (or overtaking) vehicles can be a dangerous manoeuvre.  Certain areas of the site cannot have vehicles overtaking.  Those areas of clearly demarcated and the practice does not take place.', 'Passing Vehicles', 'Do vehicles pass each other in prohibited passing areas?'),
